import React from "react";
import Navbar from "./shared/components/Navbar/Navbar";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import Home from './shared/pages/Home/Home';
import About from './shared/pages/About/About';
import Login from "./shared/pages/Login/Login";
import SignUp from "./shared/pages/Student/SignUp/SignUp";
import ForgotPassword from "./shared/pages/ForgotPassword/ForgotPassword";
import Error404 from "./shared/pages/Error404";

import Footer from "./shared/Footer/Footer";


export default function App() {
  return (
      <>
        <Router>
          <Navbar/>
          <Switch>
            <Route path='/' exact component={Home} />
            <Route path='/home' exact component={Home} />
            <Route path='/login' component={Login} />
            <Route path='/sign-up' component={SignUp} />
            <Route path='/forgot-password' component={ForgotPassword} />
            <Route path='/about' exact component={About} />

            <Route path='/error404' exact component={Error404} />
          </Switch>
        </Router>
        <Footer/>
      </>
  )
};
